import logo from './logo.svg';
import './App.css';
import WelcomePage from './WelcomePage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <WelcomePage/>
        <p>
         For booking please contact us:
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
